            CCP.stocktotal = CCP.stock.GetValueOrDefault() + CCP.updatestock.Value;
            js.InvokeVoidAsync("console.log", $"{CCP.stocktotal}");

            CCP.stock = CCP.stocktotal.Value;

            Compra.idproduto = CCP.idproduto;
